import styles from "../CSS/component.module.css";

export const UserDetailEstimator = ({ ude }) => {
  const download = async () => {
    return 0;
  };

  return (
    <div className={styles.row_container}>
      <p>{ude.ID}</p>
      <p>{ude.totalTup}</p>
      <p>{ude.dupTup}</p>
      <p>{ude.nullRatio}</p>
      <div>
        <button className={styles.tiny_button} onClick={() => download()}>
          다운로드
        </button>
      </div>
      <p>{ude.score}</p>
    </div>
  );
};
